  margin: 0 0 10px 0;
  text-align: center;
  font-size: 20px;
`
const SecondTitle = styled.h1`
  text-align: center;
  margin: 0;
`
const ContainerNav = styled.nav`
  padding: 15px 0;
`
const ListLink = styled.ul`
  display: table;
  margin: 0 auto;
`


const Header = () => (
  <ContainerHeader>
    <FirstTitle>a guide on how not to have a</FirstTitle>
    <SecondTitle>Healthy Lifestyle</SecondTitle>
  </ContainerHeader>
);

export default Header;
